Haskell.nix also provides reproducible development environments for your Haskell projects. These environments can contain not only GHC and your Haskell package dependencies, but also the required system libraries and build tools. Inside the development shell, you can run commands such as ghc, ghci, or cabal new‑build (cabal build on Cabal 3.0), and they will have all dependencies available. Every dependency will be cached in your Nix store. If you have set up Hydra CI, then your team can share pre-built dependencies. These examples assume that you have created your package set as described in Creating Nix builds for your projects and it exists in a file called default.nix. Note: Old-style cabal build and stack builds are not (yet) supported. For example, stack will (by design) download and rebuild all dependencies, even though they are available in the shell. However, if you have a Stack project, you can generate the package set with Haskell.nix, then use cabal new‑build to work on it. Starting Cabal 3.0 cabal build will work out of the box, as new style builds are the default. If you have a Cabal or Stack project with one or more packages (i.e. multiple .cabal files, not a single package with multiple components), then you will need a development environment that contains the dependencies of your packages, but not the packages themselves. This is what the shellFor function does. # shell.nix
let project = import ./default.nix;
in project.shellFor { # ALL of these arguments are optional. # List of packages from the project you want to work on in # the shell (default is all the projects local packages). packages = ps: with ps; [ pkga pkgb ]; # Builds a Hoogle documentation index of all dependencies, # and provides a "hoogle" command to search the index. withHoogle = true; # Some common tools can be added with the `tools` argument tools = { cabal = "3.2.0.0"; hlint = "latest"; # Selects the latest version in the hackage.nix snapshot haskell-language-server = "latest"; }; # See overlays/tools.nix for more details # Some you may need to get some other way. buildInputs = [ (import <nixpkgs> {}).git ]; # Sellect cross compilers to include. crossPlatforms = ps: with ps; [ ghcjs # Adds support for `js-unknown-ghcjs-cabal build` in the shell # mingwW64 # Adds support for `x86_64-W64-mingw32-cabal build` in the shell ]; # Prevents cabal from choosing alternate plans, so that # *all* dependencies are provided by Nix. exactDeps = true; } See also: Haskell.nix Library Reference: shellFor

