{ packages = { "$pkg".revision = hackage.$pkg.$version.revisions.default; "$pkg".flags = { flag1 = true; flag2 = false; ... }; ... }; compiler = { version = "8.4.4"; nix-name = "ghc844"; packages = { "binary" = "0.8.5.1"; ... }; };
} This provides enough information about the compiler, what packages the compiler ships with and the packages we want to use in our plan. This revision and flag information will be inlined into a list of packages in config.packages in modules/plan.nix. Thus config.packages will only contains packages as described in the previous section.

